import React, { useRef } from "react";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import { green } from "@material-ui/core/colors";
import {
  ThemeProvider,
  withStyles,
  makeStyles,
  createMuiTheme,
} from "@material-ui/core/styles";

export const LoginScreen = () => {
  const theme = createMuiTheme({
    palette: {
      primary: green,
    },
  });
  const handleLogin = () => {
    console.log("login");
  };

  const style_input = {
    margin: "15px 0",
  };

  const style_btn = {
    margin: "25px 0",
    color: "white",
  };

  return (
    <div>
      <h1 className="titulo">Iniciar Sesión</h1>
      <form className="form-login">
        <TextField
          color="white"
          style={style_input}
          id="user"
          label="Nombre de usuario"
          color={green}
        />
        <TextField
          style={style_input}
          type="password"
          id="password"
          label="Contraseña"
        />
        <Button style={style_btn} onClick={handleLogin} variant="outlined">
          Iniciar Sesión
        </Button>
      </form>
    </div>
  );
};
